import Head from "next/head";
import PerfectScrollbar from "react-perfect-scrollbar";

import {
  Box,
  Button,
  Card,
  CardContent,
  Container,
  Dialog,
  DialogActions,
  DialogContent,
  DialogContentText,
  DialogTitle,
  Grid,
  IconButton,
  InputAdornment,
  Pagination,
  SvgIcon,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TablePagination,
  TableRow,
  TextField,
  Typography,
} from "@mui/material";
// import { products } from "../../__mocks__/products";
import { ProductListToolbar } from "./product/product-list-toolbar";
import { ProductCard } from "./product/product-card";
import { DashboardLayout } from "../dashboard/dashboard-layout";
import { useEffect, useState } from "react";
import ValueServices from "../../services/ValueServices";
import { Search as SearchIcon } from "../../icons/search";
import { Block, Check, Delete, Edit } from "@mui/icons-material";

const Products = () => {
  const [expedientes, setExpedientes] = useState([]);
  const [tipo_asunto, setTipo_asunto] = useState([]);
  const [tipo_expediente, setTipo_expediente] = useState([]);
  const [calles, setCalles] = useState([]);
  const [distritos, setDistritos] = useState([]);
  const [tecnicos, setTecnicos] = useState([]);

  const [open, setOpen] = useState(false);

  const [page, setPage] = useState(0);
  const [rowsPerPage, setRowsPerPage] = useState(10);

  useEffect(() => {
    ValueServices.getExpedientes().then((response) => {
      console.log(response.data);
      setExpedientes(response.data);
    });
    ValueServices.getTecnicos().then((response) => {
      console.log(response.data);
      setTecnicos(response.data);
    });

    ValueServices.getTipoAsunto().then((response) => {
      console.log(response.data);
      setTipo_asunto(response.data);
    });

    ValueServices.getTipoExpediente().then((response) => {
      console.log(response.data);
      setTipo_expediente(response.data);
    });

    ValueServices.getCalles().then((response) => {
      console.log(response.data);
      setCalles(response.data);
    });

    ValueServices.getDistritos().then((response) => {
      console.log(response.data);
      setDistritos(response.data);
    });
  }, []);

  const handleClose = () => {
    setOpen(false);
  };

  // Cambiar filas por página
  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setPage(0);
  };

  const handlePageChange = (event, newPage) => {
    setPage(newPage);
  };

  return (
    <DashboardLayout>
      <Head>
        <title>Expedientes</title>
      </Head>
      <Box
        component="main"
        sx={{
          flexGrow: 1,
          py: 8,
        }}
      >
        <Container maxWidth={false}>
          <div>
            <Box sx={{ mb: 3 }}>
              <Box
                sx={{
                  alignItems: "center",
                  display: "flex",
                  justifyContent: "space-between",
                  flexWrap: "wrap",
                  m: -1,
                }}
              >
                <Typography sx={{ m: 1 }} variant="h4">
                  Expedientes
                </Typography>
                <Box sx={{ m: 1 }}>
                  <Button
                    onClick={function () {
                      setOpen(true);
                    }}
                    color="primary"
                    variant="contained"
                  >
                    Crear expedientes
                  </Button>
                </Box>
              </Box>
              <Box>
                <Card>
                  <CardContent>
                    <Box sx={{ maxWidth: 500 }}>
                      <TextField
                        fullWidth
                        InputProps={{
                          startAdornment: (
                            <InputAdornment position="start">
                              <SvgIcon color="action" fontSize="small">
                                <SearchIcon />
                              </SvgIcon>
                            </InputAdornment>
                          ),
                        }}
                        placeholder="Buscar expediente"
                        variant="outlined"
                      />
                    </Box>
                  </CardContent>
                </Card>
              </Box>
            </Box>
            <Card>
              <TableContainer sx={{ minWidth: 128 }}>
                <PerfectScrollbar>
                  <Box sx={{ minWidth: 1050 }}>
                    <Table>
                      <TableHead>
                        <TableRow>
                          <TableCell>TIPO</TableCell>
                          <TableCell>AÑO</TableCell>
                          <TableCell>CÓDIGO</TableCell>
                          <TableCell>EXPEDIENTE</TableCell>
                          <TableCell>TITULAR</TableCell>
                          <TableCell>ASUNTO</TableCell>
                          <TableCell>F. ENTRADA</TableCell>
                          <TableCell>TÉCNICO</TableCell>
                          <TableCell>F. SALIDA</TableCell>
                          <TableCell></TableCell>
                        </TableRow>
                      </TableHead>

                      <TableBody>
                        {expedientes
                          .slice(
                            page * rowsPerPage,
                            page * rowsPerPage + rowsPerPage
                          )
                          .map((expediente, index) => {
                            return (
                              // If user.activo is true the TableRow will be normal but if not it will be grey

                              <TableRow key={expediente.id} hover>
                                <TableCell>
                                  {expediente.tipo_expediente.nombre}
                                </TableCell>
                                <TableCell>{expediente.anyo}</TableCell>
                                <TableCell>{expediente.codigo}</TableCell>
                                <TableCell>{expediente.expediente}</TableCell>
                                <TableCell>
                                  {expediente.calle_1.codtipovia} /{" "}
                                  {expediente.calle_1.nomoficial},{" "}
                                  {expediente.numero} -{" "}
                                  {expediente.tipo_asunto.nombre}{" "}
                                </TableCell>
                                <TableCell>
                                  {expediente.tipo_asunto.nombre}
                                </TableCell>
                                <TableCell>
                                  {expediente.fecha_entrada_1}
                                </TableCell>
                                <TableCell>
                                  {expediente.user.username}
                                </TableCell>
                                <TableCell>
                                  {expediente.fecha_salida_1}
                                </TableCell>

                                <TableCell>
                                  <IconButton
                                    // onClick={(e) => {
                                    //   openEditUser(user);
                                    // }}
                                    color="primary"
                                    variant="contained"
                                  >
                                    <Edit />
                                  </IconButton>
                                  <IconButton
                                    // onClick={(e) => {
                                    //   deleteUser(user.id);
                                    // }}
                                    color="secondary"
                                    variant="contained"
                                  >
                                    <Delete />
                                  </IconButton>
                                </TableCell>
                              </TableRow>
                            );
                          })}
                      </TableBody>
                    </Table>
                  </Box>
                </PerfectScrollbar>
              </TableContainer>
              <TablePagination
                rowsPerPageOptions={[1, 10, 25, expedientes.length]}
                component="div"
                count={expedientes.length}
                rowsPerPage={rowsPerPage}
                page={page}
                onPageChange={handlePageChange}
                onRowsPerPageChange={handleChangeRowsPerPage}
              />
            </Card>
          </div>

          <Dialog open={open}>
            <DialogTitle>Nuevo expediente</DialogTitle>
            <DialogContent>
              <DialogContentText>
                <form>
                  <Grid container spacing={3}>
                    <Grid item xs={12} md={6}>
                      <TextField
                        focused={true}
                        type="date"
                        fullWidth
                        label="Fecha entrada"
                        name="fecha_entrada_1"
                        required
                        variant="outlined"
                      />
                    </Grid>
                    <Grid item xs={12} md={6}>
                      <TextField
                        focused={true}
                        type="date"
                        fullWidth
                        label="Fecha salida"
                        name="fecha_salida_1"
                        required
                        variant="outlined"
                      />
                    </Grid>
                    <Grid item xs={12} md={6}>
                      {/* Select desplegable */}
                      <TextField
                        fullWidth
                        label="Tipo de expediente"
                        name="tipo_expediente"
                        required
                        select
                        SelectProps={{ native: true }}
                        variant="outlined"
                      >
                        {tipo_expediente.map((tipo_expediente) => (
                          <option
                            key={tipo_expediente.id}
                            value={tipo_expediente.id}
                          >
                            {tipo_expediente.nombre}
                          </option>
                        ))}
                      </TextField>
                    </Grid>
                    <Grid item xs={12} md={6}>
                      {/* SELECT Desplegable tecnicos */}
                      <TextField
                        fullWidth
                        label="Técnico"
                        name="user"
                        required
                        select
                        SelectProps={{ native: true }}
                        variant="outlined"
                      >
                        {tecnicos.map((user) => (
                          <option key={user.id} value={user.id}>
                            {user.username}
                          </option>
                        ))}
                      </TextField>
                    </Grid>
                    <Grid item xs={12} md={6}>
                      {/* Desplegable año */}
                      <TextField
                        fullWidth
                        label="Año"
                        name="anyo"
                        required
                        select
                        SelectProps={{ native: true }}
                        variant="outlined"
                      >
                        {/* Iterate over all years going from 1970 to current year */}
                        {Array.from(
                          { length: new Date().getFullYear() - 1950 },
                          (_, index) => index + 1970
                        ).map((anyo) => (
                          <option key={anyo} value={anyo}>
                            {anyo}
                          </option>
                        ))}
                      </TextField>
                    </Grid>
                  </Grid>
                </form>
              </DialogContentText>
            </DialogContent>
            <DialogActions>
              <Button color="primary" variant="contained"></Button>
              <Button onClick={handleClose} color="primary" variant="contained">
                Cancelar
              </Button>
            </DialogActions>
          </Dialog>
        </Container>
      </Box>
    </DashboardLayout>
  );
};

export default Products;
